import React from "react";
import Box from "@mui/material/Box";
import { FcGoogle } from "react-icons/fc";
import { GrGithub } from "react-icons/gr";
export const Login = () => {
  const style = {
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%, -50%)",
    width: 400,
    bgcolor: "#ffffff",
    borderRadius: "20px",
    boxShadow: 24,
    p: 4,
    outline: 0,
  };
  return (
    <Box sx={style}>
      <div className="flex flex-col gap-10">
        <h1 className="text-2xl font-titleFont font-extrabold text-sky-900 text-center">
          Sign up for DataVault
        </h1>
        <div className="flex flex-col justify-center items-center gap-4">
          <button className="font-bodyFont text-base font-bold text-sky-950 rounded-xl px-4 py-2 bg-sky-100 flex items-center justify-center gap-4 w-4/5 ">
            <span className="rounded-full p-1 bg-white">
              <FcGoogle className="text-xl" />
            </span>
            Sign Up with Google
          </button>
          <button className="font-bodyFont text-base font-bold text-sky-950 rounded-xl px-4 py-2 bg-sky-100 flex items-center justify-center gap-4 w-4/5 ">
            <span className="rounded-full p-1 bg-white">
              <GrGithub className="text-xl" />
            </span>
            Sign Up with Github
          </button>
        </div>
      </div>
    </Box>
  );
};
